  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a collection of GeoTIFF
  and MrSID format natural color orthophotos covering Clay-Putnam County, Florida.
  An orthophoto is remotely sensed image data in which displacement of features in
  the image caused by terrain relief and sensor orientation have been mathematically
  removed. Orthophotography combines the image characteristics of a photograph with
  the geometric qualities of a map. Imagery was acquired for Clay-Putnam County at
  0.9 foot ground sample distance (GSD) resolution. Flight height maintained during
  mission was 9,000 feet AGL. The imagery was captured at 12-bit radiometric resolution
  and converted to 8-bit radiometric resolution during post processing. The imagery
  was captured with 60% forwardlap and 30% sidelap between all adjacent flight lines.
  The imagery was obtained and processed by all digital means beginning with data
  acquisition using a Z/I Imaging Digital Mapping Camera (DMC), serial number DMC01-0044.
  The orthophotos are available in GeoTIFF and MrSID form. The projected coordinate
  system is State Plane Florida East (FIPS Zone 901), NAD 83 HPGN, GRS 80, Units Feet.\",\n\t\"license_title\":
